Insert into SYSTEM.NURSETIPS (TITLE,CONTENT,TIME,STATUS) values ('居家护理中，老人的 “ 6个怎么办 ”','一 老人跌倒后怎么办? 第一步：禁止移动老人，判断老人情况; 第二步：拨打120，等待救援，注意保暖; 第三步：询问老人是否可以活动?是否有剧烈疼痛? ①如某部位剧烈疼痛，可能发生骨折了，不能搬动，等待120救援 ②无剧烈疼痛，轴线翻身，以老人衣扣为轴，两人协助侧翻身; ③伤口处理：小伤口用创口贴;大伤口用干净的布轻按伤口;擦伤，简单消毒 二、预防阿尔茨海默症应该怎么办呢? 1 多运动，每天30到60分钟 2 多动脑，学习新的知识或接触新领域 3 手指操，改善睡眠，增强记忆力。 三 吞咽困难怎么办? 1、转头法:将头转向咽肌麻痹一侧，即侧方吞咽 2、点头样吞咽:颈部尽量前屈，同时做空吞咽动作，可去除残留食物。 3、呛咳怎么处理? ①老人低头弯腰，身体前倾，下颌低向前胸。 ②如食物残渣卡在喉部，应再次弯腰低头，在老人肩胛下快速连续拍打。 ③海姆立克急救法：站在老人背后，手臂绕过胸廓下，双手指交叉， 对横隔施加一个向上猛拉的力量，可排出阻塞物。 四 预防糖尿病足怎么办? 1、控制血糖 2、不要赤足行走 3、每天检查足部及下肢皮肤 4.每天温水洗足 5.穿透气性好、舒适的鞋袜 五 尿失禁怎么办? 压力性尿失禁，可通过锻炼来缓解 六 落枕怎么办? 1 热敷在落枕 24 小时之后进行 2 以拇指按揉法作用 3. 颈部疼痛减轻后，可行颈项部锻炼。',to_date('22-7月 -29','DD-MON-RR'),'已发布');
Insert into SYSTEM.NURSETIPS (TITLE,CONTENT,TIME,STATUS) values ('陪护工作范围有哪些，怎么保证护工工作质量','在聘请了护工之后，很多人关注的不仅仅是陪护做什么，还有对方的服务质量究竟如何得到保证，尤其是在自己看不到对方工作状态的情况之下，提心会存在疏忽和偷懒等行为，有些雇主采用的是监控观察的方法，有的时候则询问被照顾人员的感受，当然这些都是事后要做的，一般来说在聘请之前就应该着手准备了。 从陪护的工作来说，陪护人员的工作职责其实是比较细致的，也是比较繁琐的，只有经过细致入微的工作，才能够让患者得到更多的呵护，得到更多的满足。以上就是关于陪护做什么的相关介绍，建议大家如果之前没有经验，在来到了护工公司之后不要轻易的做出决定，可以观察别人是怎么做的，并且尽可能的多提问，最后一定要确认签订协议作为保障。',to_date('22-8月 -06','DD-MON-RR'),'已发布');
Insert into SYSTEM.NURSETIPS (TITLE,CONTENT,TIME,STATUS) values ('涉外家政是什么？涉外家政主要做哪些服务','涉外家政的要求比较高，无论是学历，还是整体素质，都要最好的，高学历人员，对学习和适应能力都要非常的强，一般做到一专多能。涉及到的培训不仅仅是一般家政所需内容，还要进行职业道德、英语口语、摄影录像、国外生活习俗、宗教知识、法律常识、中餐西餐、家庭理财、计算机及办公设备应用、宠物饲养、病人护理、孕产妇护理、家庭教育、防身术等多方面知识学习。 关于涉外家政服务，主要要精通外语，特别是有一些雇主，他们是国外朋友，他们需要用到这一些涉外家政人员。而更主要是会做适合自己国家口味的菜系，如果你的雇主是美国人，那么你就要做美国饭菜。所以说在运用到这一些涉外家政服务的话，那么整个档次就会提升上去，它不仅仅是帮助家里边整理卫生，她更是可以与家主人进行更多的沟通，可以让这一家主人得到更多的帮助的。所以说这样的家政服务消费方面也是有一些贵的，特别是有很多大学生们，他们现在都是选择在业余时间做这一行。',to_date('22-8月 -11','DD-MON-RR'),'已发布');
Insert into SYSTEM.NURSETIPS (TITLE,CONTENT,TIME,STATUS) values ('护工陪护人员应该具备哪些素质','1、良好的心理态度 有很多的人在做护工的时候，由于服务态度并不是很好，所以说导致他们的工作质量直接下降，在很多人看来，这些类型的人是不适合做护工的，但是为了生活，他们如果没有其他方面的工作能力的话，那么在医院陪护公司学习做护工的时候，就一定要准备好自己比较良好的服务心态，因为只有这样才能够保证自己的工作不受到客户的排斥。 2、与人交流的技能 而这一切都是在护工学习的时候需要去学习的相关技能，不管是学习态度还是工作方法，在医院陪护公司学习过程当中都能够有所接触，当然重要的就是与人交流的技能，不管是与普通的人的交流，还是对病人以及老人的交流，我们都需要有一个非常得体的表达方式，如果能在表达方面都存在问题的话，那么可能让自己的工作会很难开展。 3、本职的护理卫生工作 除了交流方面的技能之外，重要的当然就是做好自己的本职工作，也就是照顾人的相关技能，照顾人虽然看起来非常简单，但是里面存在着非常多的一些细节，平常的人可能会认为，只要是病人需要做什么能帮助他们完成就是照顾病人，但是在真正的医院陪护公司的专业护工看来，他们所做的并不仅仅只有这些工作，更多的还是要能够帮助病人更好的恢复健康。',to_date('22-8月 -12','DD-MON-RR'),'已发布');
